package com.vibe.pojo.energy;

public class EnergyShowBiao {

    private Integer xuhao;
    private Object liexing;
    private Object shuzhi;
    private Object zhanbi;

    public EnergyShowBiao() {
        super();
        // TODO Auto-generated constructor stub
    }

    public EnergyShowBiao(Integer xuhao, Object liexing, Object shuzhi, Object zhanbi) {
        super();
        this.xuhao = xuhao;
        this.liexing = liexing;
        this.shuzhi = shuzhi;
        this.zhanbi = zhanbi;
    }

    public Integer getXuhao() {
        return xuhao;
    }

    public void setXuhao(Integer xuhao) {
        this.xuhao = xuhao;
    }

    public Object getLiexing() {
        return liexing;
    }

    public void setLiexing(Object liexing) {
        this.liexing = liexing;
    }

    public Object getShuzhi() {
        return shuzhi;
    }

    public void setShuzhi(Object shuzhi) {
        this.shuzhi = shuzhi;
    }

    public Object getZhanbi() {
        return zhanbi;
    }

    public void setZhanbi(Object zhanbi) {
        this.zhanbi = zhanbi;
    }
}
